import React, { Fragment } from 'react';
import { useNavigate } from "react-router-dom"
import { Button } from 'react-bootstrap';
import { MDBBtn, MDBIcon } from "mdbreact";
function HomePage() {
    const navigate = useNavigate();
    const handleClick = e => {
        // e.preventDefault()
        navigate("/" + e);
    }

    return (
        <div>
            <header>=== HOME PAGE --- SHABETZ VESA :) ===</header>
            <br></br>
            <Fragment>
                <MDBBtn color="primary" onClick={() => handleClick('SignIn')}>
                    <MDBIcon icon="magic" className="mr-1" />  sign In
                </MDBBtn>
                {/* <MDBBtn color="default">
                    Right <MDBIcon icon="magic" className="ml-1" />
                </MDBBtn> */}
            </Fragment>
            <Button onClick={() => handleClick('SignIn')}>
                sign In
            </Button>
            <Button onClick={() => handleClick('SignUp')}>
                sign Up
            </Button>
            <Button onClick={() => handleClick('About')}>
                About
            </Button>
            <Button onClick={() => handleClick('OrderDrive')}>
                Order Drive
            </Button>
            <Button onClick={() => handleClick('LogOut')}>
                Log Out
            </Button>
        </div>
    );
};
export default HomePage;
